import styled from "styled-components";

function Find() {
  return (
    <Main>
      <div className="container">
        <div className="text">ID / 비밀번호 찾기</div>
        <div className="boxes">
          <div className="box"></div>
          <div className="box"></div>
        </div>
      </div>
    </Main>
  );
}

export const Main = styled.div`
  height: 90vh;
  display: flex;
  justify-content: center;
  align-items: center;
  .container {
    width: 80vw;
    height: 60vh;
    .boxes {
      width: 80vw;
      height: 60vh;
      background-color: gainsboro;
    }
  }
`;

export default Find;
